            result.reverse();
            result.forEach(item => {
                var titel = document.createElement(""p"")
                titel.innerHTML += item[""name""]

                winkelwagen.append(titel);
            });
        }
    }

    const AddDish = (e) => {
        const target = e.target.parentElement
        const dishId = target.querySelector("".dish-id"").value;
